from PyQt5.QtGui import QPixmap, QImage, QIcon
from PyQt5.QtCore import QByteArray

class AppIcons():
	def __init__(self):
		self.maxFileIconB = b','
		self.arrowIconB = b','
		self.trashIconB = b','
		self.trashBIconB = b','
		self.folderIconB = b','
		self.crossIconB = b','
		self.tickIconB = b','
		self.diskIconB = b','


	def qIconFromBase64(self, base64):
		pixmap = QPixmap()
		pixmap.loadFromData(QByteArray.fromBase64(base64))
		_icon = QIcon(pixmap)
		return _icon

	def qImageFromBase64(self, base64):
		_image = QImage()
		_image.loadFromData(QByteArray.fromBase64(base64))
		return _image
	
	def qPixmapFromBase64(self, base64):
		pixmap = QPixmap()
		pixmap.loadFromData(QByteArray.fromBase64(base64))
		return pixmap